import { useEffect, useState } from 'react';

// üîë Builder.io „ÅÆÂÖ¨ÈñãAPI„Ç≠„Éº„Çí„Çª„ÉÉ„Éà
builder.init("104176d8c85a41958ececf0ffa09a231"); // ‚Üê Builder.io „ÅÆ API Key „ÇíÂÖ•„Çå„ÇãÔºÅ

export default function BuilderPage() {
  const [content, setContent] = useState(null);

  useEffect(() => {
    builder
      .get('page', { url: window.location.pathname }) // ‰ªä„ÅÆURL„Å´ÂØæÂøú„Åô„Çã„Éö„Éº„Ç∏„ÇíÂèñÂæó
      .promise()
